import React from 'react';
import {H1, SmallContainer, P} from '../components'
import styled from 'styled-components';

const Style = styled.div`
	display: flex;
	flex-direction: column;
	//justify-content: center;
	margin: 1rem;
	padding: 10px;
	position: relative;
	border: 5px solid black;
	width: 45%;
	height: 300px;
	margin-top: -110px;

	background-color: rgba(25,25,25,0.5);

	&:nth-of-type(odd) {
		align-self: flex-start;

	}

	&:nth-of-type(even) {
		align-self: flex-end;
	}

	&:nth-of-type(1) {
		margin-top: 0;
	}

	& .circle {
		background-color: #2E2E2E;
		border: 3px solid;
		border-color: ${props => props.color};
		border-radius: 50%;
		position: absolute;
		width: 20px;
		height: 20px;
		z-index: 1;
		right: -11%;
		top: 50%;

		.date {
			position: absolute;
			left: -20px;
			top: -20px;
		}
	}

	&:nth-of-type(even) .circle {
		left: -11%;
	}



`;

class TimelineItem extends React.Component {
	render() {
		return(
	    	<Style color={this.props.color}>

	    		<H1 borderbottom bordercolor={this.props.color}>{this.props.title}</H1>

	    		<br/>
	    		<span className='circle'>    			
	    			<P className='date'>{this.props.date}</P>
	    		</span>
	    	</Style>		    
		)
	;}
}

export default TimelineItem;
